import ProductInCartCard from "../components/ProductInCartCard";




function Cart( { cart } ) {

    items = cart.map(item => {
        return 
        <ProductInCartCard key={item.id} {...item} />
    })






    const pInCart = cart.map(item => {
        return (
            <div>
            <h1>{item.name}</h1>
            <h2>{item.price}</h2>
            <h4>{item.description}</h4>
            </div>
        )
    })
    return (
        <div>{items}</div>
    )

}

export default Cart;
